            y1 = (y - cy) / fy;
            double r2;
            r2 = pow(x1, 2) + pow(y1, 2);
            x2 = x1 * (1 + k1 * r2 + k2 * pow(r2, 2)+k3*pow(r2,3)) + 2 * p1 * x1 * y1 + p2 * (r2 + 2 * x1 * x1);
            y2 = y1 * (1 + k1 * r2 + k2 * pow(r2, 2)+k3*pow(r2,3)) + p1 * (r2 + 2 * y1 * y1) + 2 * p2 * x1 * y1;
            x_distorted = x2 * fx + cx;
