////////////////////////////////////////////
//功能：锐化图片
//输入：二值化图片
//输出：
//备注：
///////////////////////////////////////////
void sharpen() {
    float IMG_sharpen[86][256];
    float IMG_delta[86][256];
    for (int i = 0; i < 86; i++) {
        for (int j = 0; j < 256; j++) {
            IMG_delta[i][j] = abs(-5 * (IMG[i][j] - (IMG[i - 1][j] + IMG[i][j - 1] + IMG[i][j] + IMG[i][j + 1] + IMG[i + 1][j])));
            IMG_sharpen[i][j] = IMG[i][j] - IMG_delta[i][j];
        }
    }
    for (int i = 0; i < 86; i++) {
        for (int j = 0; j < 256; j++) {
            IMG[i][j] = IMG[i][j] - IMG_sharpen[i][j];
        }
    }
    for (int i = 0; i < 86; i++) {
        for (int j = 0; j < 256; j++) {
            if (IMG[i][j] > 0.8) {
                IMG[i][j] = 1;
            }
            else {
                IMG[i][j] = 0;
            }
        }
    }
}

