///////////////////////////////////////////
void cross_in() {
    find_jump_point();
    //////printf("lu=%d,ld=%d,ru=%d,rd=%d\n", leftUpJumpPoint, leftDownJumpPoint, rightUpJumpPoint, rightDownJumpPoint);
    int flag = 1;

    //判断一：找到下拐点
    if (rightDownJumpPoint>105 || leftDownJumpPoint>105
        ) {
        flag = 0;
    }
//    test_varible[13] = rightDownJumpPoint;
//    test_varible[14] = leftDownJumpPoint;
//    ////printf("flag=%d\n", flag);
    //判断二：大面积的白色
    uint8_t sumWhiteR = 0;
    uint8_t sumWhiteL = 0;
    for (int i = rightDownJumpPoint; i >= rightDownJumpPoint - 10; i--) {
        for (int j = right_line[rightDownJumpPoint]; j <= right_line[rightDownJumpPoint] + 10; j++) {
            if (IMG[i][j] == white) {
                sumWhiteR++;
            }
        }
    }
    for (int i = leftDownJumpPoint; i >= leftDownJumpPoint - 10; i--) {
        for (int j = left_line[leftDownJumpPoint]; j >= left_line[leftDownJumpPoint] - 10; j--) {
            if (IMG[i][j] == white) {
                sumWhiteL++;
            }
        }
    }
    double pR = (double)sumWhiteR / 100;
    double pL = (double)sumWhiteL / 100;
    if (pR < 0.95 || pL < 0.95) {
        flag = 0;
    }
   // test_varible[15] = flag;

    ////printf("flag=%d\n", flag);

    if (flag == 1) {
        //////printf("(0)lts=%d,ls=%d,s=%d\n", lastTwoState, lastState, state);
        if (lastTwoState == 0 && lastState == 0) {
            lastTwoState = 1;
            //////printf("(1)lts=%d,ls=%d,s=%d\n", lastTwoState, lastState, state);
        }
        else if (lastTwoState == 1 && lastState == 0) {
            lastState = 1;
            //////printf("(2)lts=%d,ls=%d,s=%d\n", lastTwoState, lastState, state);
        }
        else if (lastState == 1 && lastTwoState == 1) {
            state = 1;
            lastState = 0;
            lastTwoState = 0;
            //////printf("(3)lts=%d,ls=%d,s=%d\n", lastTwoState, lastState, state);
        }
        else {
            lastState = 0;
            lastTwoState = 0;
            //////printf("(4)lts=%d,ls=%d,s=%d\n", lastTwoState, lastState, state);
        }
    }
    else if (flag == 0) {
        lastState = 0;
        lastTwoState = 0;
        //////printf("(5)lts=%d,ls=%d,s=%d\n", lastTwoState, lastState, state);
    }




}

