//功能：出十字路口
//输入：
//输出：
//备注：
///////////////////////////////////////////
void cross_out() {
    find_jump_point();
    int flag = 1;

    if ((rightDownJumpPoint==119 || leftDownJumpPoint==119)
        ||(rightDownJumpPoint<=95 && leftDownJumpPoint==95)) {
        flag = 1;
    }
    else {
        flag = 0;
    }
    if (rightUpJumpPoint != 119 && leftUpJumpPoint!=119) {
        flag = 1;
    }
    else {
        flag = 0;
    }
    //下方赛道边缘miss
    int sumM = 0;
    //////printf("lu=%d,ld=%d,ru=%d,rd=%d\n", leftUpJumpPoint, leftDownJumpPoint, rightUpJumpPoint, rightDownJumpPoint);
    for (int i = 106; i >= 90; i--) {
        if (abs(left_line[i] - missLeft[i]) <= 1 && abs(right_line[i] - missRight[i]) <= 1) {
            sumM++;
        }
    }

    double k = (double)sumM / 17;
    if (k < 0.8) {
        flag = 0;
    }
    //




    if (flag == 1) {
        if (lastTwoState == 0 && lastState == 0) {
            lastTwoState = 1;
        }
        else if (lastTwoState == 1 && lastState == 0) {
            lastState = 1;
        }
        else if (lastState == 1 && lastTwoState == 1) {
            state = stateOutCrossStraight;
            lastState = 0;
            lastTwoState = 0;
        }
        else {
            lastState = 0;
            lastTwoState = 0;
        }
    }
    else if (flag == 0) {
        lastState = 0;
        lastTwoState = 0;
    }

}

