////////////////////////////////////////////
//功能：结束十字
//输入：
//输出：
//备注：
///////////////////////////////////////////
void cross_over() {
    int flag = 1;

    double kl = calculate_slope(40, 90, LEFT);
    double kr = calculate_slope(40, 90, RIGHT);
    double dl = variance(40, 90, LEFT);
    double dr = variance(40, 90, RIGHT);
    ////printf("%f,%f,%f,%f\n", kl, kr, dl, dr);

    if (fabs(kl - kr) > 0.5 || fabs(dl - dr) > 5) {
        flag = 0;
    }
    if (flag == 1) {
        if (lastTwoState == 0 && lastState == 0) {
            lastTwoState = 1;
        }
        else if (lastTwoState == 1 && lastState == 0) {
            lastState = 1;
        }
        else if (lastState == 1 && lastTwoState == 1) {
            state = 0;
            lastState = 0;
            lastTwoState = 0;
        }
        else {
            lastState = 0;
            lastTwoState = 0;
        }
    }
    else if (flag == 0) {
        lastState = 0;
        lastTwoState = 0;
    }
}
